import React from 'react';

import 'antd/dist/antd.css';
import './App.css';

import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom' 
import OARBeliAdd from './components/OARBeliAdd.jsx';

function App() {
  const App = () => {
    return (
      <div className="App">
        <Router>
          <div>
            <nav>
              <ul>
                <li>
                  <Link to='/OARBeli/add'>Add OARBeli</Link>
                </li>
              </ul>
            </nav>

            <Switch>
              <Route path='/OARBeli/add' component={OARBeliAdd}/>
            </Switch>
          </div>
        </Router>
      </div>
    );
  }

  return (
      <App />
  );
}


export default App;
